  return (
    <Router>
      <Header />  
      <main>
        <Container className='text-center'>
          <h1>Welcome to Jack's Tea</h1>  
          <Route path='/' component={HomeScreen} exact />
          <Route path='/product/:id' component={ProductScreen}  />
        </Container>
      </main>
      <Footer />
    </Router>
  );
}

export default App;
